import './App.css';
import Header from './components/header';
import AddTimeTable from './components/AddTimeTable';

import {BrowserRouter as Route, Routes} from 'react-router-dom'



function App() {
  return (
    <Routes>
        <div>
          <Header/>

          <Route path="/AddTimeTable" exact component={AddTimeTable}/>

        </div>

        </Routes>




  );
}

export default App;
